  "text" : "時々見るよね、こういうすっごい凝ってる夢。ちなみに設定もしっかりしてて自分は18歳の高校生で、お嬢さまは5つ下の中1だった。生き残ったのは自分とお嬢さまと、組の中でちょっとおちゃらけた掴みどころのないでも優しいお兄さん。 [l]",
