  "text" : "最後は、組長と一緒に、組長の兄にして元締めの組長を暗殺する場面。どちらにも可愛がってもらって、でも仕方なくって。組長が兄の暗殺に失敗した後に自分が飛びかかって暗殺に成功する。「ごめんなさいごめんなさい」って涙ボロボロ流しながら「お嬢を頼む」って言われてエンディングだった。 #夢",
