  "text" : "見える・・・見えるぞ！すき家のゼンショーとかが企業農業へ参入してバイトを高ノルマで酷使して達成できなかったらサービス残業させて、でも「うちの労働者じゃなくて委託です！」って言い張って福祉も残業代も出さない未来が・・・。",
