  "id_str" : "278869923068006402",
  "text" : "農業の企業参入で思うのは、それって戦前の寄生地主と何が違うのだろう？って。特に昨今のサービス残業やら超過労働時間うんぬんの話を聞いてると、大儲けする企業役員（地主）と搾取される労働者（小作）という図式しか思いつかない。",
