  "text" : "でも本来はそうじゃなくて、私たち一般人は、候補者の人柄をみて「この人なら変なことはしないだろう」って信頼して代表として送り出して、なにかあったら「これってどうなの」って直接意見を言える、そんなのが良いと思う。",
